import logo from "../src/assets/logo.png"

function App() {
  return (
    <nav className=" flex justify-between items-center shadow-xl bg-cyan-200">
      <img className=" w-20 rounded-full p-2" src={logo} alt="logo"/>
      <ul className="flex gap-5 hover: bg-slate-400">
        <li><a href="#">Home</a></li>
        <li><a href="#">About</a></li>
        <li><a href="#">Contact Us</a></li>
        <button className="bg">Login</button>
        <button>SignUp</button>

      </ul>
    </nav>
  );
}

export default App;
